webpackJsonp([0xf40edb38be95],{323:function(e,A){e.exports={data:{markdownRemark:{html:'<!-- # Machine Learning Your Death -->\n<p>Here\'s a project a few friends and I created for Dr. Polo Chau\'s class, CX4242 - Data and Visual Analytics. This was one of my favorite classes at Tech, and judging from the size of the class, breath of the class, and rave reviews from friends in all different majors, it\'s a lot of people\'s favorite class.</p>\n<p>Like I said, the class had a LOT of breath. Here\'s a slide from the last day of class acknowleding how many different and diverse technologies we used. Back in June, I couldn\'t image being comfortable with these twenty-some technologies</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-3ac1b.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 74.47513812154696%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt-text"\n        title=""\n        src="/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-b80fa.jpg"\n        srcset="/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-cf410.jpg 163w,\n/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-62f2a.jpg 325w,\n/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-b80fa.jpg 650w,\n/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-08cb4.jpg 975w,\n/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-f2bf9.jpg 1300w,\n/static/slide-9a7f6e6e7304e1b1a3bcfda36d5e6022-3ac1b.jpg 1810w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Anyways, the project for this class had three criteria:</p>\n<ol>\n<li>at least one large, real dataset;</li>\n<li>some non-trivial analysis/algorithms/computation performed on the dataset (e.g., computing basic statistics, like average, min/max will not be enough); and</li>\n<li>an interactive user interface that interact with the algorithms (can be visual, voice-controlled, on tablet, desktop, etc.).</li>\n</ol>\n<p>So for our project, we attempted to predict how you\'re going to die. We got a</p>\n<ol>\n<li>large dataset from the cdc</li>\n</ol>\n<p>We cleaned, parsed, and joined the data into a usable form, and stored it back as a csv. Then we used python and pandas to further manipulate the data. This second manipulation step was required because we didn\'t quite know what we wanted to do with the data. For example, we decided to one-hot encode it to remove numerical relations on the categorical data.</p>\n<p>Now with regards to the data, we had five fields to predict a persons death out of fourty-three different causes... so early on we gave up the dream of very accurate predictions, and in turned created a fun and interesting user interface.</p>\n<p>Click <a href="http://cx.sam-ford.me">here</a> to check out the site and see how you die as time passes based on your age, race, gender, marital status, and education.</p>',frontmatter:{path:"/machine-learning-your-death",title:"Machine Learning Your Death",subtitle:"",date:"2017-12-21T00:11:45-03:00",indexImage:{childImageSharp:{resolutions:{width:1200,height:800,src:"/static/terminator-71e6ca14489b4d52e2e6b3e1e994ed5a-3278f.jpg",srcSet:"/static/terminator-71e6ca14489b4d52e2e6b3e1e994ed5a-3278f.jpg 1x"}}}}}},pathContext:{}}}});
